import React from 'react';
import './App.css';

function App() {

  return (
    <div>
      <ul>
        {data.map((item) => (
          <div key={item.id}>
            <li>{item.material}</li>
            <li>{item.grade}</li>
            <li>{item.thickness}</li>
            <li>{item.comments}</li>
            <img src={data.image_url} alt="Image" />
          </div>
        ))}
      </ul>
    </div>
  );
}

export default App;
